import React from 'react';
import Head from 'next/head';
import Link from 'next/link';

// import ListPosts from '../components/ListPosts';
import posts from './posts/index.json';

const Home = () => (
  <div>
    <Head>
      <title>Home</title>
    </Head>

    <div>
      {posts.map((post, index) => (
        <Link key={index} href={post.url}>
          {post.title}
        </Link>
      ))}
    </div>
  </div>
);

export default Home;
